  const [isVideoPlaying, setIsVideoPlaying] = useState(false);

  const toggleVideo = () => {
    setIsVideoPlaying(!isVideoPlaying);
  };

  return (
    <section
      className="hero-section"
      style={{
        backgroundImage: `url(${onxytreeImage})`, // Use the imported image
        backgroundSize: "cover",
        backgroundPosition: "center center",
        width: "100%",
        height: "400px",
      }}
    >
      {/* Overlay and video code */}
    </section>
  );
}

export default Hero;
